  "privacy_content": "<h2>Gizlilik Uyarısı</h2> <p>Bu gizlilik bildirimi PharmaLedger Birliği Elektronik Ürün Bilgileri ürününün kullanımı için geçerlidir. </p><h2>İletişim Bilgileri</h2><ul class=\"list-space\" role=\"list\"><li role=\"listitem\"><b>a) Denetleyicinin veya ortak denetleyicilerin kimliği ve irtibat bilgileri</b><p>Verilerinizin denetleyicisi PharmaLedger Derneği'dir.</p></li><li role=\"listitem\"><b>b) Veri koruma görevlisinin irtibat bilgileri</b><p>PharmaLedger Derneği'nin Veri Koruma Bürosuna dpo@pharmaledger.org adresinden ulaşılabilir.</p></li></ul><h2>Hangi Kişisel Verileri Kullanıyoruz</h2><p>Yalnızca elektronik broşürünüzü iletmek için gereken teknik verileri toplarız. Bu, IP adresinizi ve uygulamamıza erişmek için kullandığınız cihazın ve tarayıcının teknik tanımlayıcılarını içerir.</p><p><em>Detaylandırmak gerekirse, aşağıdaki veri unsurlarını toplamaktayız:</em></p><ul><li><p><em>Mobil Cihaz Erişimi.</em> Mobil cihazınızın kamerası ve diğer bazı özellikleri de dahil olmak üzere mobil cihazınızdan belirli özelliklere erişim veya izin talep edebiliriz. Erişimimizi veya izinlerimizi değiştirmek isterseniz, bunu cihazınızın ayarlarından yapabilirsiniz.</p></li><li><p><em>Mobil Cihaz Verileri.</em> Cihaz bilgilerini (mobil cihaz kimliğiniz, cihaz modeli ve üreticisi gibi), işletim sistemi, sürüm bilgileri ve sistem yapılandırma bilgilerini, cihaz ve uygulama kimlik numaralarını, tarayıcı türü ve sürümünü, donanım modelini İnternet servis sağlayıcısı ve/veya mobil operatör ve İnternet Protokolü (IP) adresini (veya proxy sunucusu) otomatik olarak toplarız. Uygulamamızı/uygulamalarımızı kullanıyorsanız, mobil cihazınızın bağlı olduğu telefon şebekesi, mobil cihazınızın işletim sistemi veya platformu, kullandığınız mobil cihazın türü, mobil cihazınıza özel cihaz kimliği ve eriştiğiniz uygulamamızın/uygulamalarımızın özellikleri hakkında da bilgi toplayabiliriz.</p></li></ul><h2>Kişisel Bilgileriniz Neden Topluyoruz</h2><h3>Amaçlar</h3><p> Teknik verilerinizi, ilacınızın elektronik ürün broşürünü size sunmak amacıyla topluyoruz.</p><p>Bu nedenle, kişisel bilgilerinizi işlemek için aşağıdaki yasal dayanaklara başvurabiliriz:</p><ul><li><p><b>Bir Sözleşmenin İfası.</b> Kişisel bilgilerinizi, Hizmetlerimizi sunmak da dahil olmak üzere sözleşmeden doğan yükümlülüklerimizi yerine getirmek için gerekli olduğuna inandığımızda veya sizinle bir sözleşme yapmadan önce talebiniz üzerine işleyebiliriz.</p></li><li><p><b>Yasal Yükümlülükler.</b> Sağlık mevzuatı ve kamu sağlığı mevzuatı kapsamındaki yükümlülüklerimizi yerine getirmek gibi yasal yükümlülüklerimize uymak için gerekli olduğuna inandığımız durumlarda bilgilerinizi işleyebiliriz.</p></li></ul><h2>Kişisel Bilgilerinizi Kimlerle Paylaşıyoruz</h2><p>Üye Şirketler ve Üçüncü Taraf Hizmet Sağlayıcılar.</p><p>Verilerinizi, bizim için veya bizim adımıza hizmet veren ve bu işi yapmak için bu tür bilgilere erişmesi gereken üçüncü taraf satıcılar, hizmet sağlayıcılar, yükleniciler veya aracılarla ('üçüncü taraflar') paylaşıyoruz. Üçüncü taraflarımızla, kişisel bilgilerinizin korunmasına yardımcı olmak üzere düzenlenmiş sözleşmelerimiz bulunmaktadır. Bu, biz talimat vermediğimiz sürece kişisel bilgilerinizle hiçbir şey yapamayacakları anlamına gelir. Ayrıca kişisel bilgilerinizi bizim dışımızda hiçbir kuruluşla paylaşmayacaklardır. Ayrıca, bizim adımıza tuttukları verileri korumayı ve talimat verdiğimiz süre boyunca saklamayı taahhüt ederler. Kişisel bilgileri paylaşabileceğimiz üçüncü taraf kategorileri aşağıdaki gibidir:</p><ul><li><p> İlaç Üreticileri (Üye Şirketler)</p></li><li><p>Teknik Servis Sağlayıcıları</p></li></ul><h2>Kişisel Verilerinizi Ne Kadar Süreyle Saklıyoruz </h2><p>PharmaLedger Birliği, teknik verilerinizi yalnızca broşür talebinizi işleme koymak için gerekli olan süre boyunca 30 güne kadar saklı tutar.</p><p>İlaç üreticiniz de verilerinizi veri saklama politikalarına göre tanımlanmış bir süre boyunca saklayacaktır, bu saklama hakkında daha fazla bilgi için lütfen ilaç üreticinizle iletişime geçin.</p><h2>Kişisel Verilerinizi Bize Vermemeniz Durumunda</h2><p>Teknik verilerinizi bize vermemeyi tercih ederseniz, broşür talebinizi yerine getiremeyiz.</p><h2>Haklarınız</h2><p>KVKK kapsamındaki kişisel verilerinizle ilgili, verilerinize erişme veya verilerinizi silme istemi gibi herhangi bir talebiniz varsa, dpo@pharmaledger.org adresinden bizimle iletişime geçebilirsiniz.</p><p>Bu tür talepleri 30 gün içinde işleme koyacağız.</p><h2>İznin İptali</h2><p>KVKK kapsamındaki kişisel verilerinizle ilgili, verilerinize erişme veya verilerinizi silme istemi gibi herhangi bir talebiniz varsa, dpo@pharmaledger.org adresinden bizimle iletişime geçebilirsiniz. </p><p>Bu tür talepleri 30 gün içinde işleme koyacağız.</p><h2>Otomatik Karar Verme</h2><p>Size bu hizmeti sunarken herhangi bir otomatik karar verme mekanizması kullanmıyoruz.</p><h2>Kişisel Verilerin Uluslararası Aktarımı </h2><p>İlaç üreticinizin verilerinizi Avrupa Birliği dışına aktarmamızı talep ettiği durumlarda, verilerinizi korumak için Standart Sözleşme Maddelerini kullanırız.</p><h2>Nasıl Şikayette Bulunulur</h2><p>KVKK kapsamındaki kişisel verilerinizle ilgili, verilerinize erişme veya verilerinizi silme istemi gibi herhangi bir talebiniz varsa, dpo@pharmaledger.org adresinden bizimle iletişime geçebilirsiniz.</p><p>Bu tür talepleri 30 gün içinde işleme koyacağız. Ayrıca, haklarınızın gözetilmediğini düşünüyorsanız yerel denetim makamınızla iletişime geçebilirsiniz.</p>",
