  "terms_content": "<h2> PharmaLedger Derneği Elektronik Ürün Bilgileri Web Sitesi ve Uygulaması için Hüküm ve Koşullar </h2><p>PharmaLedger Birliğinin Elektronik Ürün Bilgileri web sitesine ve uygulamasına (\"Hizmetler\") erişerek veya bunları kullanarak, bu hüküm ve koşulları (\"Şartlar\") kabul etmiş olursunuz. Bu Şartları kabul etmiyorsanız Hizmetlere erişemez veya Hizmetleri kullanamazsınız. Hizmetler, PharmaLedger Birliği (\"Birlik\") tarafından yürütülmektedir ve ilaçları hakkında bilgi edinmek isteyen bireyler tarafından kullanılmak üzere tasarlanmıştır. Hizmetler çok taraflı bir ağ tarafından sağlanır ve ilaç üreticiniz Hizmetler aracılığıyla görüntülenen ürün bilgilerini sağlar. Birlik, bu bilgiler için veri denetleyicisi rolünü üstlenmektedir. </p><h2>Hizmetlerin Kullanımı</h2><p>Hizmetleri yalnızca yasal amaçlar için ve herhangi bir üçüncü tarafın haklarını ihlal etmeyecek veya Hizmetleri kullanmasını ve bunlardan yararlanmasını kısıtlamayacak veya engellemeyecek şekilde kullanmayı kabul etmektesiniz. Bahsi geçen kısıtlama veya engelleme, herhangi bir sınırlama olmaksızın, yasa dışı olan veya herhangi bir kişiyi taciz edebilecek veya sıkıntıya veya rahatsızlığa neden olabilecek davranışları ve müstehcen veya saldırgan içeriğin iletilmesini veya Hizmetler içindeki normal diyalog akışının bozulmasını içerir. </p><h2> Fikri Mülkiyet </h2><p> Hizmetlerin metin, grafik, resim ve yazılım dahil ancak bunlarla sınırlı olmamak üzere içeriği, Birliğin veya lisans verenlerinin ve üye şirketlerinin mülkiyetindedir ve telif hakkı ve diğer fikri mülkiyet yasaları ile korunmaktadır. Birliğin açık yazılı izni olmaksızın Hizmetlerdeki hiçbir içerik herhangi bir ticari amaç için kullanılamaz. </p><h2> Yükümlülük </h2><p> Birlik, Hizmetlerin işleyişi veya Hizmetlerde yer alan bilgi, içerik, malzeme veya ürünlerle ilgili olarak açık veya zımni hiçbir beyan veya garanti vermez. Birlik, Hizmetlerin kullanımından kaynaklanan doğrudan, dolaylı, arızi, cezai ve müteakip zararlar dahil ancak bunlarla sınırlı olmamak üzere hiçbir zarardan sorumlu olmayacaktır. </p><h2>Geçerli Hukuk </h2><p> Bu Koşullar ve Hizmetleri kullanımınız İsviçre yasalarına tabidir ve bu yasalara göre yorumlanacaktır ve her türlü anlaşmazlık Basel, İsviçre mahkemelerinde çözülecektir. </p><h2> Şartlarda Yapılan Değişiklikler </h2><p>Dernek bu Şartları istediği zaman değiştirme hakkını saklı tutar ve bu Şartlarda herhangi bir değişiklik olup olmadığını periyodik olarak kontrol etmek sizin sorumluluğunuzdadır. Şartlarda herhangi bir değişiklik yapıldıktan sonra Hizmetleri kullanmaya devam etmeniz, revize edilmiş Şartları kabul ettiğiniz anlamına gelecektir.</p><p><br></p>",
  "about_modal_subtitle": "Hakkında",
  "about_modal_title": "PharmaLedger",
  "about_content": "<h2>Bu Uygulama Hakkında</h2><p>Bu uygulama PharmaLedger® tarafından sağlanmaktadır. Hasta temsilcisi kuruluşlar, ilaç şirketleri ve teknoloji uzmanları tarafından ortaklaşa geliştirilmiştir.</p><p>Uygulama kullanıcılarının, ürün ambalajı üzerindeki barkodu tarayarak ilaçları hakkındaki bilgileri görüntülemelerine imkan tanır.</p><p>Gösterilen bilgiler ürünün Pazarlama Ruhsatı Sahibi tarafından sağlanmaktadır.</p><h2>PharmaLedger Hakkında</h2><p>PharmaLedger®, PharmaLedger Birliği'nin (PLA) marka adıdır.<p>PLA, kâr amacı gütmeyen, tarafsız küresel bir dernektir. Birliğin amacı, sağlık hizmetlerinde dijital bir güven ekosistemi oluşturmak ve teşvik etmektir.</p><p>Birlik, sağlık ve yaşam bilimleri sektörlerinde işbirliğini teşvik eder ve hastaların ve diğer paydaşların ortak yararı için yenilikleri ve bunların uygulanmasını destekler.</p>",
