  "help_content": "<div><p><b><h2>EPI nedir?</h2></b></p><p> <b>EPI</b> elektronik ürün bilgisi için kullanılan bir kısaltmadır. Genellikle bir eczacılık ürünü paketinin içinde bulabileceğiniz kağıt Ürün Bilgisi broşürünün elektronik halidir. Bazı durumlarda kağıt broşürün yerini <b>EPI</b> alabilir.</p><p><b><h2>PharmaLedger nedir?</h2></b></p><p>PharmaLedger Birliği (PLA), standart hale getirilmiş ve güvenilir bir açık kaynak platformu aracılığıyla sağlık hizmetlerinde Dijital Güven Ekosistemini mümkün kılmak ve teşvik etmek amacıyla İsviçre merkezli, kâr amacı gütmeyen bir birliktir. PLA, hastalar ve diğer paydaşlar için sağlık ve yaşam bilimleri alanlarında ortak faydalar elde etmek amacıyla işbirliğini teşvik eder, yenilikçiliği ve uygulamaya geçişi hızlandırır. PLA, Avrupa Komisyonu ve ilaç endüstrisi tarafından finanse edilen ve blockchain çözümlerinin değerini kanıtlamayı amaçlayan 3 yıllık bir proje olan PharmaLedger projesinin çalışmalarını sürdürmek üzere 2022 yılında kurulmuştur. Daha fazla bilgiye https://pharmaledger.org adresinden ulaşabilirsiniz.</p><p><b><h2>DataMatrix nedir?</h2></b></p><p>Ürün paketinizdeki bir barkod türüdür. Siyah beyaz kare bir kutu barkoddur ve aşağıdaki gibi görünecektir:<br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Uygulama nasıl kullanılır?</h2></b></p><p> <b>Uygulamanın </b> açılış sayfasındaki talimatları uygulayın... Ürün Paketinizde <b>karekodun (DataMatrix)</b> nerede bulunacağına dair bir resim bulunmaktadır. Karekodu bulduktan sonra, 'Karekodu Tara' düğmesine tıklayın. Karekodun taranabilmesi için uygulamanın kamerayı kullanmasına izin verin. Kamera ile karekod üzerine odaklanın. Paket başarıyla tarandıktan sonra EPI görüntülenecektir. Daha fazla ayrıntı almak için '+' düğmesine tıklayabilirsiniz.</p><p><b><h2>Neden DataMatrix taramam bir sonuç vermiyor?</h2></b></p><p>Paketinizdeki <b>DataMatrix'in </b> EPI vermemesinin birkaç nedeni olabilir. Sebeplerden biri kameranın odağı olabilir. Lütfen kodu iyi aydınlatılmış ve ekranda net bir şekilde görülebilen bir yerde taramaya çalışın. Elinizi sabit tutmakta zorlanıyorsanız, ellerinizi desteklemek için bir masa kullanmayı deneyebilirsiniz.</p></div>",
